import React from 'react';
import { Box, Stack } from '@mui/system';

import ResultBlock from "./ResultBlock";

const Display = (props) => {
  return (
    <Box>
      <Stack
        spacing={2}
      >
        {props.history != null ? props.history.map((item, key) => (
          <ResultBlock
            key={key}
            actions={ item.actions }
            result={ item.result }
          />
        )) : null}
      </Stack>
    </Box>
  )
}

export { Display };
